import Link from 'next/link';
import React from 'react';

interface Props {
    forSale: boolean;
}

export default class SculpturesSeeAll extends React.Component<Props> {
    render() {
        const { forSale } = this.props;

        return (
            <Link href="/p/[id]" as={`/p/${forSale ? 1 : -1}`}>
                <a className="see-all">
                    See All
                </a>
            </Link>
        )
    }
}
